Mongoose projection to filter list not working, but native does<p>I'm trying to use the following find query to find a list of objects which are related to a &quot;work&quot; object with a specific ID, then return all &quot;form&quot; elements which aren't set to inactive (active = false).</p>
<p>This works perfectly using the mongo shell locally, or <a href="https://mongoplayground.net/p/EjHHpWx05Pg" rel="nofollow noreferrer">testing on mongoplayground</a>. But I can't figure out how to get mongoose to play nice and return the results I expect, I always get an empty array.</p>
<p>I don't understand why it would work perfectly find natively, but not via mongoose. There must be some kind of issue or peculiarity I'm not finding in the docs. My mongodb version is 5.0.5 and my mongoose version is 6.1.5.</p>
<p>Mongo find query I'm trying to use:</p>
<pre><code>db.objects.find({
  &quot;work&quot;: ObjectId(&quot;61d50a22eed3f421dc33a220&quot;)
},
{
  &quot;form&quot;: {
    &quot;$filter&quot;: {
      &quot;input&quot;: &quot;$form&quot;,
      &quot;as&quot;: &quot;form&quot;,
      &quot;cond&quot;: {
        &quot;$ne&quot;: [
          &quot;$$form.active&quot;,
          false
        ]
      }
    }
  }
})
</code></pre>
<p>Mongoose code with Projection (not working, returning []):</p>
<pre><code>export const getWIObjects = async (workID: string) =&gt; {
  const objs = await ObjectModel.find({
    work: new mongoose.Types.ObjectId(workID),
  }).select({
    form: {
      $filter: {
        input: &quot;$form&quot;,
        as: &quot;form&quot;,
        cond: {
          $ne: [&quot;$$form.active&quot;, false],
        },
      },
    },
  });
  return objs;
};
</code></pre>
<p>Mongoose code WITHOUT projection (returning data, but will include inactive fields):</p>
<pre><code>export const getWIObjects = async (workID: string) =&gt; {
  const objs = await ObjectModel.find({
    work: new mongoose.Types.ObjectId(workID),
  });
  return objs;
};
</code></pre>

